import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './Pages/Home';
import Trivia1 from './Pages/Trivia1';
import Profile from './Pages/Profile';
import SignUp from './Pages/Auth'; // Assuming this is the correct import for SignUp
import axios from 'axios';
import Questionnaire from './Pages/Question';
import './App.css';

function App() {
  const [games, setGames] = useState([]);

  useEffect(() => {
    const fetchNbaGames = async () => {
      try {
        const response = await axios.get(
          'https://www.balldontlie.io/api/v1/games'
          // Add any necessary query parameters based on the API documentation
        );

        setGames(response.data.data);
      } catch (error) {
        console.error('Error fetching NBA games:', error);
      }
    };

    fetchNbaGames();
  }, []);

  const [currentUser, setCurrentUser] = useState(null);

  const handleSignUp = (username) => {
    setCurrentUser(username);
  };

  return (
    <Router>
      <div>
        <nav className='head-nav'>
          {currentUser ? (
            <ul>
              <li>
                <Link to="/questionnaire">Questionnaire</Link>
              </li>
            </ul>
          ) : (
            <ul>
              <li>
                <Link to="/auth">Sign Up</Link>
              </li>
            </ul>
          )}

          <p>Logo</p>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/events" element={<Trivia1 />} />
          <Route path="/Profile" element={<Profile />} />
          <Route path="/auth" element={<SignUp onSignUp={handleSignUp} />} />
          <Route
            path="/questionnaire"
            element={currentUser ? <Questionnaire username={currentUser} /> : <Navigate to="/auth" />}
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
